define("mathEditor/dataUtil",["dojox/xml/parser","dojo/_base/array"],function(xmlParser,array){var dataUtil={};return dataUtil.xmlDocToHtml=function(xmlDoc){var xmlString="",root=xmlDoc.documentElement,lines=root.childNodes;return array.forEach(lines,function(line,index){var lineString="<div class='drip_line'>",spans=line.childNodes;array.forEach(spans,function(span,index){if(span.nodeName=="text")lineString+="<span>"+span.textContent+"</span>";else if(span.nodeName=="math"){var tmp=xmlParser.innerXML(span);lineString+=tmp.replace(/&amp;/g,"&")}}),lineString+="</div>",xmlString+=lineString}),xmlString},dataUtil.xmlStringToHtml=function(xmlString){var doc=xmlParser.parse(xmlString);return this.xmlDocToHtml(doc)},dataUtil})